import React from 'react'

const Timer = (props) => {
  const minutes = Math.floor(props.timeleft / 60)
  const seconds = props.timeleft % 60
  return (
    <div style={{ fontWeight: 'bold', display: 'inline-flex' }}>
      <span>{minutes}</span>
      <span>
        {' '}
        :
        {() => {
          if (seconds < 10) {
            return (<span>0</span>)
          }
        }}
        {seconds}
      </span>
    </div>
  )
}

export default Timer
